mso-border-bottom-alt:0.5000pt dashed rgb(0,0,0);"><p class="MsoNormal" style="vertical-align: top;"><span style="font-family: 微软雅黑; color: rgb(255, 0, 0); font-size: 12pt;">4、东莞清溪总仓，义乌仓，福永仓，广州仓，佛山仓，收货不加费用，上海仓，青岛仓、厦门仓收货+0.5元/KG.按计费重收费；非我司原因的退货，产生退货费用：50RMB/CBM/,最低消费50元/CBM，如从各个卫星仓中转回东莞清溪总仓后退仓，除了退仓费以外,广东地区收取转运费50元/CBM/票起，最低收费50元/票；广东以外地区收取转运费150元/CBM/票起，最低收费150元/票。单件超1吨，或整票体积超6个方的大货，建议送总仓，如果送卫星仓，可能会产生请叉车费。 </span><span style="font-family: 微软雅黑; color: rgb(255, 0, 0); font-size: 12pt;"><br></span><span style="font-family: 微软雅黑; color: rgb(255, 0, 0); font-size: 12pt;">5、国内仓储费：非我司原因，从入仓日起算免仓7天，第8-30天收取</span><span style="font-family: 微软雅黑; color: rgb(0, 204, 255); font-size: 12pt;">2元/CBM/天</span><span style="font-family: 微软雅黑; color: rgb(255, 0, 0); font-size: 12pt;"><font face="微软雅黑">，第</font><font face="微软雅黑">31-60天收取</font></span><span style="font-family: 微软雅黑; color: rgb(0, 204, 255); font-size: 12pt;">3元/CBM/天</span><span style="font-family: 微软雅黑; color: rgb(255, 0, 0); font-size: 12pt;"><font face="微软雅黑">，不足</font><font face="微软雅黑">1CBM按照1CBM算，超过60天未支付仓储费的按照弃货处理。</font></span><span style="font-family: 微软雅黑; color: rgb(255, 0, 0); font-size: 12pt;"><br></span><span style="font-family: 微软雅黑; color: rgb(255, 0, 0); font-size: 12pt;">6、国内理货费：分批入仓的货物，前3批免理货费，从第4批开始收取50元/批的理货费。</span><span style="font-family: 微软雅黑; color: rgb(255, 0, 0); font-size: 12pt;"><br></span><span style="font-family: 微软雅黑; color: rgb(255, 0, 0); font-size: 12pt;">7、体积除6000，实重与体积重取大值作为计费重，单件不足12KG按照12KG算，单票不足50kg按50kg计费。一票多件的计费标准：单件计费，实重按照实重，抛货按照抛货算。</span><span style="font-family: 微软雅黑; color: rgb(255, 0, 0); font-size: 12pt;"><br></span><span style="font-family: 微软雅黑; color: rgb(0, 204, 255); font-size: 12pt;">8、海外仓储费：因客户原因导致货物拦截存放海外仓的，存放时间最长不超7天，超过7天当弃货处理。0-3天收取40元/CBM/天，4-7天收取60元/天/CBM。不足1CBM按照1CBM算。通知扣货起，预支付7天的仓储费。因客户原因导致货物拦截存放海外派送站点的，将收取60元/CBM/天的储存费，3天后退回海外仓，产生的所有费用由发货方承担。</span><span style="font-family: 微软雅黑; color: rgb(0, 204, 255); font-size: 12pt;"><br></span><span style="font-family: 微软雅黑; color: rgb(0, 204, 255); font-size: 12pt;">7、海外弃货费：因客户原因导致货物无法派送造成弃货的，收取弃货费15元/kg, 按计费重收费，最低50kg起收.</span><span style="font-family: 微软雅黑; color: rgb(255, 0, 0); font-size: 12pt;"><br></span><span style="font-family: 微软雅黑; color: rgb(255, 0, 0); font-size: 12pt;">9、改派地址或者二次派送</span><span style="font-family: 微软雅黑; color: rgb(255, 0, 0); font-size: 12pt;"><br></span><span style="font-family: 微软雅黑; color: rgb(255, 0, 0); font-size: 12pt;"><font face="微软雅黑">（</font><font face="微软雅黑">1）由于客户原因需要更改派送地址的，高价区域改低价区域的不退差价，低价区域改高价区域的，必须补齐我司差价。</font></span><span style="font-family: 微软雅黑; color: rgb(255, 0, 0); font-size: 12pt;"><br></span><span style="font-family: 微软雅黑; color: rgb(255, 0, 0); font-size: 12pt;"><font face="微软雅黑">（</font><font face="微软雅黑">2）改单费：装柜后~到港前：改单费300元/票；到港后~入海外仓前：改单费500元/票；入海外仓后~出仓派送前：改单费800元/票；出仓派送后需要改单改派的，将根据具体情况另议收费。所有到港后改地址的订单，不保证改派成功。</font></span><span style="font-family: 微软雅黑; color: rgb(255, 0, 0); font-size: 12pt;"><br></span><span style="font-family: 微软雅黑; color: rgb(255, 0, 0); font-size: 12pt;"><font face="微软雅黑">（</font><font face="微软雅黑">3）二次派送费：收取单票总费用的30%起。</font></span><span style="font-family: 微软雅黑; color: rgb(255, 0, 0); font-size: 12pt;"><br></span><span style="font-family: 微软雅黑; color: rgb(255, 0, 0); font-size: 12pt;">10、滞纳金：我司实行款到装货原则，开船/发车超过7天未付款的，将收取200元起/票滞纳金。</span><span style="font-family: 微软雅黑; color: rgb(255, 0, 0); font-size: 12pt;"><o:p></o:p></span></p></td></tr><tr style="height:159.0000pt;"><td width="151" valign="center" style="width:113.9000pt;padding:0.0000pt 5.4000pt 0.0000pt 5.4000pt ;border-left:1.0000pt solid rgb(0,0,0);
