mso-border-bottom-alt:0.5000pt dashed rgb(0,0,0);"><p class="MsoNormal" style="vertical-align: top;"><span style="font-family: 微软雅黑; color: rgb(255, 0, 0); font-size: 12pt;">1，报价表的邮编如在离岛上，不一定有服务，特别是法国/意大利/西班牙/希腊的离岛，需要单询</span><span style="font-family: 微软雅黑; color: rgb(255, 0, 0); font-size: 12pt;"><br></span><span style="font-family: 微软雅黑; color: rgb(255, 0, 0); font-size: 12pt;">2，如因收货人地址在市中心、步行街、施工限行路段、或因道路狭窄导致无法通行货车进行派送的，发货人需在下单时提前告知。如未提前告知，导致无法派送或者要改用小型车辆派送的，产生额外费用（包括二次派送费、换车费、滞留费等）由发货人承担。</span><span style="font-family: 微软雅黑; color: rgb(255, 0, 0); font-size: 12pt;"><br></span><span style="font-family: 微软雅黑; color: rgb(255, 0, 0); font-size: 12pt;">3，收货人电话和邮箱为必填项，如因未提供正确的收货人电话和邮箱导致改单、时效延误、派送失败、二次派送、货物退回等一切风险和费用，由发货人承担。</span><span style="font-family: 微软雅黑; color: rgb(255, 0, 0); font-size: 12pt;"><br></span><span style="font-family: 微软雅黑; color: rgb(255, 0, 0); font-size: 12pt;">4，因清关查验率升高，不接纺织品，包括地毯、窗帘、帐篷、鞋服、背包、购物袋、布料、床罩、床单等</span><span style="font-family: 微软雅黑; color: rgb(255, 0, 0); font-size: 12pt;"><br></span><span style="font-family: 微软雅黑; color: rgb(255, 0, 0); font-size: 12pt;">5，因海外存仓费用高，弃货和销毁风险大，收货人信息不全的，无法配货。</span><span style="font-family: 微软雅黑; color: rgb(255, 0, 0); font-size: 12pt;"><br></span><span style="font-family: 微软雅黑; color: rgb(255, 0, 0); font-size: 12pt;">6，我司不接受打托的包装方式（航空箱除外），请客户打好木架和木箱后再送仓。若客户坚持打托出，需签免责声明，货损和短缺的风险由发货人承担。</span><span style="font-family: 微软雅黑; color: rgb(255, 0, 0); font-size: 12pt;"><o:p></o:p></span></p></td></tr><tr style="height:43.0000pt;"><td width="151" valign="center" style="width:113.9000pt;padding:0.0000pt 5.4000pt 0.0000pt 5.4000pt ;border-left:1.0000pt solid rgb(0,0,0);
